import React from "react";
import Game from "../Shop/Game/Game";
import s from "../";

const Library = (props) => {
  let state = props.shopPage;
  console.log(props);
  let gamesElements = [
    state.games.map((g) => (
      <Game
        key={g.id}
        name={g.gameName}
        photo={g.gamePhoto}
        developer={g.developer}
        price={g.gamePrice}
      />
    )),
  ];

  return (
    <div className={s.shopContent}>
      <ShopHeader status={state.status} Search={props.Search} />
      <div>
        <div className={s.games}>{gamesElements}</div>
      </div>
    </div>
  );
};

export default Library;
